import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { FaBars, FaTimes, FaMoon, FaSun, FaUser, FaStar, FaSearch } from "react-icons/fa";

const Navbar = () => {
  const [darkMode, setDarkMode] = useState(localStorage.getItem("darkMode") === "true");
  const [menuOpen, setMenuOpen] = useState(false);
  const [searchQuery, setSearchQuery] = useState("");
  const [filteredResults, setFilteredResults] = useState([]);
  const [showDropdown, setShowDropdown] = useState(false);

  useEffect(() => {
    if (darkMode) {
      document.documentElement.classList.add("dark");
    } else {
      document.documentElement.classList.remove("dark");
    }
    localStorage.setItem("darkMode", darkMode);
  }, [darkMode]);

  // Sample search data (this can be replaced with API results later)
  const searchData = [
    { name: "Aries", link: "/horoscope#aries" },
    { name: "Taurus", link: "/horoscope#taurus" },
    { name: "Gemini", link: "/horoscope#gemini" },
    { name: "Daily Horoscope", link: "/horoscope" },
    { name: "Weekly Horoscope", link: "/horoscope?weekly" },
    { name: "Zodiac Compatibility", link: "/compatibility" },
    { name: "Astrology Blog", link: "/blog" },
    { name: "Premium Consultation", link: "/premium-consult" },
  ];

  const handleSearch = (query) => {
    setSearchQuery(query);
    if (query.length > 0) {
      setFilteredResults(
        searchData.filter((item) => item.name.toLowerCase().includes(query.toLowerCase()))
      );
      setShowDropdown(true);
    } else {
      setShowDropdown(false);
    }
  };

  return (
    <nav className="bg-white dark:bg-gray-900 shadow-lg fixed top-0 left-0 w-full z-50 transition-all">
      <div className="max-w-7xl mx-auto px-6 flex justify-between items-center py-4">
        {/* Logo */}
        <Link to="/" className="text-3xl font-bold text-yellow-500 transition hover:scale-105 flex items-center">
          🔮 AstroSphere
        </Link>

        {/* Search Bar */}
        <div className="relative hidden md:block">
          <input
            type="text"
            className="px-4 py-2 rounded-full bg-gray-200 dark:bg-gray-800 text-black dark:text-white w-64 focus:outline-none focus:ring-2 focus:ring-yellow-500"
            placeholder="Search astrology topics..."
            value={searchQuery}
            onChange={(e) => handleSearch(e.target.value)}
          />
          <FaSearch className="absolute right-3 top-3 text-gray-600 dark:text-gray-300" />

          {/* Search Dropdown Results */}
          {showDropdown && (
            <div className="absolute top-12 left-0 bg-white dark:bg-gray-800 shadow-lg rounded-lg w-64">
              {filteredResults.length > 0 ? (
                filteredResults.map((result, index) => (
                  <Link
                    key={index}
                    to={result.link}
                    className="block px-4 py-2 hover:bg-gray-200 dark:hover:bg-gray-700 rounded-md"
                    onClick={() => setShowDropdown(false)}
                  >
                    {result.name}
                  </Link>
                ))
              ) : (
                <p className="px-4 py-2 text-gray-500 dark:text-gray-300">No results found</p>
              )}
            </div>
          )}
        </div>

        {/* Dark Mode & Login */}
        <div className="flex items-center space-x-4">
          <button onClick={() => setDarkMode(!darkMode)} className="text-gray-700 dark:text-white text-lg transition">
            {darkMode ? <FaSun /> : <FaMoon />}
          </button>
          <Link to="/login" className="px-4 py-2 bg-yellow-500 text-black rounded-full hover:bg-yellow-600 transition flex items-center">
            <FaUser className="mr-2" /> Login
          </Link>
        </div>

        {/* Mobile Menu Button */}
        <button className="md:hidden text-gray-700 dark:text-white text-2xl" onClick={() => setMenuOpen(!menuOpen)}>
          {menuOpen ? <FaTimes /> : <FaBars />}
        </button>
      </div>

      {/* Mobile Menu */}
      {menuOpen && (
        <ul className="md:hidden bg-white dark:bg-gray-900 shadow-md p-4 text-center">
          <li><Link to="/" className="block py-2 text-gray-700 dark:text-white hover:text-yellow-400">Home</Link></li>
          <li><Link to="/horoscope" className="block py-2 text-gray-700 dark:text-white hover:text-yellow-400">Daily Horoscope</Link></li>
          <li><Link to="/horoscope?weekly" className="block py-2 text-gray-700 dark:text-white hover:text-yellow-400">Weekly Horoscope</Link></li>
          <li><Link to="/compatibility" className="block py-2 text-gray-700 dark:text-white hover:text-yellow-400">Compatibility</Link></li>
          <li><Link to="/premium-consult" className="block py-2 text-gray-700 dark:text-white hover:text-yellow-400">Premium Consultation</Link></li>
          <li><Link to="/blog" className="block py-2 text-gray-700 dark:text-white hover:text-yellow-400">Blog</Link></li>
          <li>
            <button onClick={() => setDarkMode(!darkMode)} className="block w-full py-2 text-gray-700 dark:text-white hover:text-yellow-400">
              {darkMode ? "🌞 Light Mode" : "🌙 Dark Mode"}
            </button>
          </li>
        </ul>
      )}
    </nav>
  );
};

export default Navbar;
